map.on('load', function() {
  map.addImage('pulsing-dot', pulsingDot, { pixelRatio: 3 });
  map.addLayer({
    id: 'hospitals',
    type: 'symbol',
    source: {
      type: 'geojson',
      data: hospitals
    },
    layout: {
      'visibility': 'none',
      'icon-image': 'hospital-15'
    },
    paint: { }
  });

  map.addLayer({
    id: 'libraries',
    type: 'circle',
    source: {
      type: 'geojson',
      data: libraries
    },
    paint: {
            "circle-color": "#11b4da",
            "circle-radius": 4,
            "circle-stroke-width": 1,
            "circle-stroke-color": "#fff",
            "circle-opacity": 0.3,
    },
    layout: {
      'visibility': 'none',
    },
  });




  map.addSource('nearest-hospital', {
    type: 'geojson',
    data: {
      type: 'FeatureCollection',
      features: []
    }
  });
});

var popup = new mapboxgl.Popup();

map.on('mousemove', function(e) {

  var features = map.queryRenderedFeatures(e.point, { layers: ['hospitals', 'libraries'] });
  if (!features.length) {
    popup.remove();
    return;
  }

  var feature = features[0];

  popup.setLngLat(feature.geometry.coordinates)
  .setHTML(  "<h5 style='color:steelblue'>"+feature.properties.Name +
  '</br>'+ '<h6>Address: '+feature.properties.Address+' </br>'+" </h6>")
  .addTo(map);



  map.getCanvas().style.cursor = features.length ? 'pointer' : '';

});

map.on('click', function(e) {
  var libraryFeatures = map.queryRenderedFeatures(e.point, { layers: ['libraries'] });
  if (!libraryFeatures.length) {
    return;
  }

  var libraryFeature = libraryFeatures[0];

  var nearestHospital = turf.nearest(libraryFeature, hospitals);

  if (nearestHospital !== null) {

    map.getSource('nearest-hospital').setData({
      type: 'FeatureCollection',
      features: [nearestHospital]
    });

    map.addLayer({
      id: 'nearest-hospital',
      type: 'circle',
      source: 'nearest-hospital',
      paint: {
        'circle-radius': 50,
        'circle-color': '#486DE0',
        "circle-stroke-color": "#1A476F",
        "circle-stroke-opacity": 1,
        "circle-stroke-width": 2,
        'circle-opacity': 0.5,
      }
    }, 'hospitals');
  }
});
